import { Route } from 'react-router';
import './App.css';
import Login from './component/Login';
import Register from './component/Register';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path='/' element={<Login />} />
        <Route path='register' element={<Register />} />
      </Routes>

    </div>
  );
}

export default App;
